  useEffect(() => {
    get_user().then(data => setUser(data)); 
  }, []);
  
  if (playlists)
    console.log('user: ', user);
  
  return (
    <div className="App">
        <h1>{ user.display_name }</h1>
        <img src={ user.images.url } />
    </div>
  );
}

export default User;
